$_MODULE['<{ets_cfultimate}prestashop>help_55deac9cea67b28b657a3414d491a1e5'] = 'Formularze kontaktowe';
$_MODULE['<{ets_cfultimate}prestashop>help_e78f8e3951507d3ad70bad04d263a0f6'] = 'Jeśli podczas tworzenia nowego formularza kontaktowego klikniesz link [1]„Dodaj nowe pole/wiersz wprowadzania, aby utworzyć formularz kontaktowy”[/1] i wybierzesz pole wprowadzania, domyślnie to pole zostanie umieszczone w pełnym rząd szerokości (1 kolumna)';
$_MODULE['<{ets_cfultimate}prestashop>help_44bc6f8a71dc89fff236e12f6f869244'] = 'Aby dodać pole wejściowe reCAPTCHA, musisz najpierw włączyć reCAPTCHA. Przejdź do [1]„Ustawienia > Integracja > reCAPTCHA”[/1], włącz opcję reCAPTCHA i wprowadź swoją parę kluczy.';
$_MODULE['<{ets_cfultimate}prestashop>help_fde06cf9e07c495e4089187d22fe1f8b'] = 'Aby dowiedzieć się, jak uzyskać klucz witryny reCAPTCHA i tajny klucz, przeczytaj dokumentację naszego modułu';
$_MODULE['<{ets_cfultimate}prestashop>help_f9654c9df3f610569dd727b769581e6f'] = 'Aby móc odpowiadać na wiadomości klientów bezpośrednio w zapleczu, potrzebujesz adresu e-mail klienta. Budując formularz kontaktowy, pamiętaj o dodaniu pola do wprowadzania adresu e-mail i zaznaczeniu go jako pola wymaganego.';
$_MODULE['<{ets_cfultimate}prestashop>help_df8334930ebd39a1c1bd49057ddb3586'] = 'Konfiguracje e-maili';
$_MODULE['<{ets_cfultimate}prestashop>help_439cf3a9e0342a20b68fcded2619e240'] = 'Aby uzyskać informacje z formularza kontaktowego na wiadomość e-mail wysłaną do administratora lub automatycznej odpowiedzi, skopiuj i wklej odpowiednie znaczniki poczty w polu [1]„Treść wiadomości”[/1] w [1]„Formularze kontaktowe > Poczta „[/1] podkarta';
$_MODULE['<{ets_cfultimate}prestashop>help_853b64314f465e7a1ebc1c63287ac7f1'] = 'Aby otrzymać plik załącznika od klienta pocztą e-mail, przejdź do [1]„Formularze kontaktowe > Poczta”[/1] i zaznacz pole [1]„Plik załącznika”[/1].';
$_MODULE['<{ets_cfultimate}prestashop>help_7f83c7fcf109140ce437c3822fa1ce7a'] = 'Aby otrzymać plik załącznika od klienta za pośrednictwem zakładki „Wiadomości”, przejdź do [1]„Formularze kontaktowe > Ustawienia”[/1] i włącz opcję [1]„Zapisz załączniki”[/1].';
